A bit speechless this morning. Trying to soak that in. Returning to Canadian nationals after 5 years and having such a great day going 1-1-2 in a really stack 250 class is something that can be saved in history books of Canadian moto. Being 34 years old racing some really talented kids that are half my age is a big challenge to overcome. I am really proud of myself. I’m having more fun than ever on my dirtbike. Motivated for more of this! Thanks to everyone that deeply believe in me again 🫶🏼. See you guys at round 2.
—- 
Je suis un peu sans mots ce matin. J’essaie de réaliser ce qui vient de se passer. Faire un retour au national canadien après 5 ans d’abscence et finir 1-1-2 contre une classe 250 très féroce c’est quelque chose qui peut être enregistrer dans l’histoire de la moto canadienne. À 34 ans, courir contre des jeunes hyper talentueux qui ont la moitié de mon âge est tout un défi à relever. Je suis très fier de moi et je suis motivé pour plus! Merci à tous ceux qui ont profondément cru en moi à nouveau 🫶🏼. On se voit à la round 2
