Kamloops was a rough one this year! Super challenging track. Had good speed but just wasn’t able to be consistent. One crash in both motos gave me a harder time. 2-4 is the result. Ready to rebound in Calgary next weekend. Thanks to my awesome team for the hard work. 
—-
Kamloops en était une difficile cette année! Une track ultra challengeante. Ma vitesse était bonne toute la journée mais je n’ai pas réussis à être constant. J’ai tombé dans les deux courses ce qui m’a rendu la vie plus difficile. Le résultat 2-4. Je suis prêt à rebondir la fin de semaine prochaine à Calgary. 

