Round 4 of @triplecrownseries in the books. Struggled all day with my riding. Moto 1 wasn’t terrible but was lacking speed and poor line choices bumped me off the podium with a 4th place. I was so happy to turn things around for moto 2 and getting the win after a long moto of battles with Harrison. Hope he is ok after that big get off.
Sand del lee next weekend! Let’s go!
—-
La round 4 est derrière nous. J’avais de la misère toute la journée. La première course n’était pas terrible mais mes mauvais choice de ligne et manque de vitesse m’ont coûté un podium. J’ai terminé 4e. J’étais hyper content de retourner ça de bord pour la 2e manche en remportant la course. Une longue bataille avec Harrison que ça été! Sand del lee la fin de semaine prochaine! Let’s go!

