Always hard to swallow set backs… I’ve had an awesome run so far at this championship. Accomplishing some things that a lot of people never thought I could of done this year. Unfortunately my crashes from sand del lee left me with some serious injuries. I showed up to moncton yesterday with the will to try but it wasn’t enough. (9-DNS) I have a separated shoulder, broken bone in the foot and a really bruised inner ankle. Need time to heal right now. I will keep my head up. Thanks to my awesome team for all the effort. See you guys soon.
—- 
C’est toujours dur d’avaler ce genre d’épreuve… j’ai eu une très belle lancée jusqu’à maintenant dans ce championnat. J’ai accompli certaine chose que plusieurs ne croyait pas possible et j’en suis fier. Malheureusement, mes crash de sand del lee m’ont laissé avec de sérieuses blessures. Je me suis présenté à Moncton hier avec beaucoup de vouloir, mais ça ne suffisait pas. (9-DNS) J’ai une séparation de l’épaule, un os de cassé dans le pied et un sérieux ecchymose à l’intérieur de la cheville. J’ai besoin de temps pour guérir. Je garde la tête haute. Je voudrais remercier mon incroyable équipe pour tout le travail. On se voit bientôt.
—-

