There’s nothing like racing at home! 🙌🏼 so blessed my body gave me the chance to experience that once again! I really missed it. That energy all around the track is always the best feeling ever. Despite the fact that I didn’t finish on the box overall, I had a awesome day and gave it my all. Thanks everyone for the support 🫶🏼 (4-3) for 4th overall
—-
Il n’y a rien qui égalise courser à la maison!! 🙌🏼 je me sens tellement privilégié d’avoir eu la chance de vivre ça à nouveau. Je m’étais vraiment ennuyé de cela. L’énergie qu’il y avait autour du circuit était juste incroyable. Malgré le fait que je n’ai pas terminé sur le podium au combiné, j’ai eu énormément de plaisir. J’ai donné tout ce que j’avais. Merci à tous pour le support 🫶🏼. (4-3) pour 4e overall.

