That’s a wrap for the 2023 @triplecrownseries ! It was so much fun coming back to racing full time. I enjoyed my year with an awesome team. Congrats to the little brother @rydermcnabb164 for back to back championships 👊🏼. I Finished 3rd in the championship. I feel it’s a great accomplishment. For the last round, i went 4-3 at @waltonraceway. So thankful to live this life again. Decisions on next year will be made in a little bit. Thanks everyone for the support. 🙏🏼
—-
La saison nationale 2023 est déjà derrière nous. J’ai eu beaucoup de plaisir à revenir courser à temps plein. Ça été une année extraordinaire avec une équipe de feu! J’ai terminé 3e au championnat. Je suis satisfait de ma saison. J’ai terminé 4-3 pour la dernière manche à Walton. Je me sens très chanceux de pouvoir vivre cette vie encore et être compétitif. Des décisions sur la saison prochaine seront prises prochainement. Merci à tous pour le support 🙏🏼

